import axios from "axios";


class InmuebleService {
  constructor() {
    this.api = axios.create({
     baseURL: "http://localhost:8080/inmuebles"

    });
  }

  getAll() {
    return this.api.get("/inmuebles");

  }
}

export default InmuebleService;
